import React from 'react';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { Container, Grid, TextField } from '@mui/material';
import Paper from '@mui/material/Paper';
import { useNavigate } from 'react-router-dom';
//Importamos el useDispatch del react-redux
import { useDispatch} from 'react-redux'
//Importamos el componente loginActions que está en el fichero storelogin.js
import { loginActions } from '../store/storelogin';




function Login() {
  const navigate = useNavigate()
  const dispatch = useDispatch()

  



  return (
      <Container>
        <Grid container justifyContent="center" alignItems="center">
          <Grid item xs={12} sm={6} md={4} lg={3} xl={2}>
            <Box
              sx={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
                minHeight: '500px',
                minWidth:'400px'
              }}
            >
              <Paper elevation={5}>
                <Typography variant="h6" component="h1">
                  Acceder
                </Typography>
                <TextField required fullWidth id="usuario" variant="outlined" label="Usuario" />
                <TextField required fullWidth id="contraseña" variant="outlined" label="Contraseña" type="password"/>
                <Button variant="contained" color="primary" fullWidth>
                  Iniciar Sesión
                </Button>
              </Paper>
            </Box>
          </Grid>
        </Grid>
      </Container>
  );
}

export default Login;
